import React from 'react';
import 'antd/dist/antd.css';
import { Route } from 'react-router-dom';
import "./StyleMenu.css";
import { Link } from 'react-router-dom'

import { logOut } from "../Api/auth"


export default function LayoutSeguridad(props) {

    const { routes } = props;

    const logoutUser = () => {
        logOut()
        window.location.href = "/"
    }


    return (

        <div>
            <header>
                <div className="sticky-top">
                    <nav className="navbar navbar-expand-lg navbar-light bg-light">
                        <Link to='/adminSeguridad'><a className="navbar-brand">Home</a></Link>
                        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                            <span className="navbar-toggler-icon"></span>
                        </button>
                        <div className="collapse navbar-collapse" id="navbarSupportedContent">
                            <ul className="navbar-nav mr-auto">
                                <li className="nav-item ">
                                    <Link to='/adminSeguridad/listaUsuarios'><a className="nav-link">Usuarios<span className="sr-only">(current)</span></a></Link>
                                </li>
                                <li className="nav-item">
                                    <Link to='/adminSeguridad/listaCajas'><a className="nav-link" >Cajas</a></Link>
                                </li>
                                <li className="nav-item">
                                    <Link to='/adminSeguridad/listaRoles'><a className="nav-link">Roles</a></Link>
                                </li>
                                <li className="nav-item">
                                    <Link to='/adminSeguridad/listaConsecutivos' ><a className="nav-link ">Consecutivos</a></Link>
                                </li>
                                <li className="nav-item">
                                    <Link to='/adminSeguridad/listaUM'><a className="nav-link" >Uni. Medida</a></Link>
                                </li>
                                <li id="btnAudit" className="nav-item">
                                    <Link to='/adminSeguridad/listaPaises'><a className="nav-link" >Paises</a></Link>
                                </li>
                                <li id="btnAudit" className="nav-item">
                                    <a className="nav-link" id="logoutButton" onClick={logoutUser}>Cerrar Sesión</a>
                                </li>
                            </ul>
                        </div>
                    </nav>
                    <div className="spanheader"></div>
                </div>
            </header>
            <div style={{ padding: '0 50px' }}>
                <LoadRouters routes={routes} />
            </div>
        </div>

    );

}


function LoadRouters({ routes }) {

    return routes.map((route, index) => (

        <Route
            key={index}
            path={route.path}
            exact={route.exact}
            component={route.component}
        />

    ));
}
